import React from "react";
import Logo from "../assets/waldo-logo.png";
import "./Main.css";

export default function Main() {
	return (
		<main>
			<div className="logo">
				<img src={Logo} alt="Waldo Logo" className="waldo-logo" />
				<h3>Where's Waldo?</h3>
			</div>
		</main>
	);
}
